import React, { useEffect, useState } from 'react'

export const HomePage = () => {
  const [teams, setTeams] = useState([])

  useEffect(() => {
    const getAllTeams = () => {
      const response = fetch(`http://localhost:8080/teams`)
      const data = response.json()

      setTeams(data)
    }
    getAllTeams()
  }, [teams])

  return <div>HomePage</div>
}
